/**
 * @description Returns {String} of HTTP path requests
 */
const MAIN_PATH = '/api/projects/statuses';

export default class PROJECTS_STATUSES {
   static GET_PROJECTS_STATUSES = MAIN_PATH + '/';
   static GET_PROJECT_STATUS_BY_NAME = MAIN_PATH + '/name/';
   static CREATE_NEW_PROEJCT_STATUS = MAIN_PATH + '/';
   static UPDATE_PROJECT_STATUS = MAIN_PATH + '/';
   static DELETE_PROJECT_STATUS_BY_ID = MAIN_PATH + '/id=';
}
